import './App.css';
import Practice from './components/Practice';
import Waterqulity from './components/Waterqulity';
import NavBar from './components/NavBar';
import Polution from './components/Polution';
import ReviewForm from './components/ReviewForm';

function App() {

  return (

    <BrowserRouter>
      <div>
        <NavBar/>
      </div>
      <div className="mt-5">
      <Routes>
          <Route exact path="/business" element={<Practice pagesize={this.pageSize} country="in" category="business" page={1}/>} />
          <Route exact path="/tech" element={<Polution pagesize={this.pageSize} country="in" category="technology" page={1}/>} />
          <Route exact path="/sports" element={<Waterqulity pagesize={this.pageSize} country="in" category="sports" page={1}/>} />
          <Route exact path="/science" element={<ReviewForm pagesize={this.pageSize} country="in" category="science" page={1}/>} />
          <Route exact path="/entertainment" element={<sign pagesize={this.pageSize} country="in" category="entertainment" page={1}/>} />
          <Route exact path="/" element={<News pagesize={this.pageSize} country="in" category="general"/>} />
          <Route exact path="/about" element={<News pagesize={this.pageSize} country="in" category="general" page={1}/>} />
          <Route exact path="/health" element={<News pagesize={this.pageSize} country="in" category="health" page={1}/>} />

      </Routes>
      </div>
      </BrowserRouter>
    // <div> 

    //   <div className="container">

    //     <Practice />
    //     <ReviewForm />
    //     <Polution />
    //   </div>
    // </div>
  );
}

export default App;
